import React from 'react';
import './SkillsSection.css';

const SkillsSection = () => {
    const skills = [
        'JavaScript',
        'React.js',
        'Node.js',
        'CSS',
        'HTML',
        'Python',
        'SQL',
        'Git',
        'Docker',
        'AWS'
    ];

    return (
        <section className="skills-section">
            <h2>Habilidades</h2>
            <ul className="skills-list">
                {skills.map((skill, index) => (
                    <li key={index} className="skill-item">
                        {skill}
                    </li>
                ))}
            </ul>
        </section>
    );
};

export default SkillsSection;
